const FiltroPesquisa = (props) => {

    const clickActive = event =>{
        console.log("Botao clicado foi", props.tab)




        if (props.tab == "#1"){
            console.log("Porpos")
            var target = event.target
            var parent = target.parentElement;

              parent.classList.add('active');
        }


    }

    return (<div>
            <li id="active"><a   href={props.tab}>{props.label} </a></li>
        
    </div>);
}

